import React from "react";
import '../stylesheets/Tags.css'

function Tags ({ tags }) {
  return (
    <div className="tags">
      {tags.split(",").map((tag,index) => (
        <span key={index} className="badge badge-secondary">{tag}</span>
      ))}
    </div>
  );
}

export default Tags;
